import React from 'react';
import {  Link } from 'react-router-dom';
import s from './NavBar.module.css';
import SearchBar from '../SearchBar/SearchBar'
import radar from '../Icons/logophoto3.png'

export default function NavBar(filterByGenre, filterByOrigin, searchByName) {

    return (
            <nav>
                 <div className={s.items}>
                   <div className={s.titleCreate}>
                    <Link className= {s.link} to ='/home'> <img src={radar} alt='radar'></img> </Link>
                   </div>
                     <SearchBar filterByGenre={filterByGenre} filterByOrigin={filterByOrigin} searchByName={searchByName}/>
                    <div className={s.userBar}>
                        <Link className={s.link} to='/logIn' ><a> LOG IN </a></Link>
                        <a> SIGN UP </a>
                        <a> FAQ </a>
                     </div>

                 </div>
            </nav>
    )
}
